	private static void CheckCount(String str) {
		List<Integer> countList = new ArrayList<Integer>();
		int len = str.length();
		String tmp = "";
		for(int i = 0;i<len;i++) {
			String s = str.substring(i,i+1);
//			System.out.println(s);
			int index = tmp.indexOf(s);
			if(index < 0) {
				tmp +=s;
				Integer count = new Integer(1);
				countList.add(count);
			} else {
				Integer c = countList.get(index);
				c++;
				countList.set(index, c);
			}
		}
		for(int j = 0;j<tmp.length();j++) {
			if(countList.get(j) == 1) {
				System.out.println(tmp.substring(j,j+1) + " --- " + countList.get(j));
				System.out.println("***************************");
			}
			if(countList.get(j) == 5) {
				System.out.println(tmp.substring(j,j+1) + " --- " + countList.get(j));
				System.out.println("***************************");
			}
			char c = tmp.charAt(j);
			if(!(c>='a'&&c<='z') && !(c>='A'&&c<='Z')) {
				System.out.println(tmp.substring(j,j+1) + " --- " + countList.get(j));
			}
		}
		
	}

